snippet.description:
So many people over analyze, over think, and over complicate things.  Parks on the Air activations don't need to be complicated.  
I had a few minutes to get out to my local park before rains moved in and threw a 20m Hamstick on the back glass of the F-150.  I made fantastic contacts all over everywhere.  POTA simply doesn't have to be complicated.
Get passed the over thinking and just get in a park, turn on the radio, and call CQ.  You'll be amazed at the fun you'll have.
