snippet.description:
Disclaimer:  This video is intended as fun entertainment.  
A. I know Parks on the Air is not a contest.
B. It didn't really bother me to be 8 QSOs short of the Park lead.
C. Well, maybe it did just a little.

I activated US-9847, Clark Creek Natural Area, on 12/19/25.  It was the week of Christmas and I was short of time, so I rushed things a little. It wasn't until later that I realized I left the park only 8 QSOs short of the park lead.  That's Silly.
The only thing I could do is go back and take over the lead.  The previous leader, KB5ILL, will surely retake the lead, but for now......

Thanks for watching and please take this for the fun entertainment it is intended to be.  If, you were one of the 37 contacts made that day, thank you for putting me on top of the leader board. LOL

